"feedback_content" : "Dear, I am the developer of private browser;
  We are preparing a new product that can aggregate the content of your favorite YouTube, Twitter, Facebook and other websites to improve the efficiency of users browsing messages. You can browse the entire network without switching back and forth between websites.Content;
  In order to better develop our products, we invite you to participate in our product development, we hope to get your suggestions, you can tell us what you like to see, we will add this content to our products.
  In addition, we have also developed a short video app that you can download and use."
